// Import Styled
import styled from 'styled-components';

export const IconChevronDown = styled.button`
	box-sizing: border-box;
	font-size: 9px;
	width: 16px;
	height: 16px;
	margin-left: 8px;
	background: #5A6ABC;
	border-radius: 50px;
	cursor: pointer;
	span{
		color: #fff;    
		margin-top: 3px;
	    display: block;
	}
`;
